import React from "react";

import {
  makeStyles,
  createMuiTheme,
  ThemeProvider,
  Paper
} from "@material-ui/core";

const useStyles = makeStyles({
  mainBg: {
    position: "fixed",
    height: "100vh",
    width: "100vw"
  }
});

export const PrimaryLayout = ({ children }) => {
  const classes = useStyles();
  return <Paper className={classes.mainBg}>{children}</Paper>;
};
